import React from 'react';
import {Page} from "../../components/Page";
import {PropertyInfoWrapper} from "../Home/components/PropertyCard/styled";
import {SubTitle} from "../../globalStyles";
import {PropertyTypeLabel} from "../../components/PropertyTypeLabel";
import {IoPricetags} from "react-icons/io5";
import {PropertyTypeBusinessWrapper} from "../../components/PropertyTypeBusiness/styled";

export const Property = () => {
    return (
        <Page>
           <div>
               <div>icono</div>
               <div>icono 2</div>
               <div>
                  img
               </div>
             <div>
                 <h3> Apartamento en laures</h3>
                 <div>
                     <SubTitle>Laureles, Medellin</SubTitle>
                     <PropertyTypeLabel />
                 </div>
              <div>
                  <IoPricetags />
                  <p>Venta</p>
              </div>

                 <div>
                     <h4>descripcion</h4>
                     <p>Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias dun libro de textos especimen. No sólo sobrevivió 500 años, sino que tambien ingresó como texto de relleno en documentos electrónicos, quedando esencialmente igual al original. Fue popularizado en los 60s con la creación de las hojas "Letraset", las cuales contenian pasajes de Lorem Ipsum, y más recientemente con software de autoedición, como por ejemplo Aldus PageMaker, el cual incluye versiones de Lorem Ipsum.</p>
                 </div>

             </div>
           </div>
        </Page>
    );
};
